import React from 'react'

const BotList = ({names, setNames}) => {
  return (
    <div>
      {names.map((name) => (
        <div className='contain'>
          <li className='list-item' key={name.id}>
              {name.title}
            <button className='button-delete-align'>
              <i className='bi-trash'></i></button>
          </li>
        </div>
        )
      )}
    </div>
  )
}


export default BotList
